void IClientEntity::SetAbsOriginal(Vector origin)
{
	using SetAbsOriginFn = void(__thiscall*)(void*, const Vector &origin);
	static SetAbsOriginFn SetAbsOrigin;

	if (!SetAbsOrigin)
		SetAbsOrigin = (SetAbsOriginFn)(game::search.pattern("client_panorama.dll", (BYTE*)"\x55\x8B\xEC\x83\xE4\xF8\x51\x53\x56\x57\x8B\xF1\xE8\x00\x00", "xxxxxxxxxxxxx??"));

	SetAbsOrigin(this, origin);
}
void IClientEntity::SetAbsAngles(Vector angle)
{
	using SetAbsAnglesFn = void(__thiscall*)(void*, const Vector &angle);
	static SetAbsAnglesFn SetAbsAngles;

	if (!SetAbsAngles)
		SetAbsAngles = (SetAbsAnglesFn)(game::search.pattern("client_panorama.dll", (BYTE*)"\x55\x8B\xEC\x83\xE4\xF8\x83\xEC\x64\x53\x56\x57\x8B\xF1\xE8", "xxxxxxxxxxxxxxx"));

	SetAbsAngles(this, angle);
}

void IClientEntity::SetAngle2( Vector wantedang ) {
	typedef void( __thiscall* oSetAngle )( void*, const Vector & );
	static oSetAngle _SetAngle = ( oSetAngle )( ( uintptr_t )game::search.signature( "client_panorama.dll", "55 8B EC 83 E4 F8 83 EC 64 53 56 57 8B F1" ) );
	_SetAngle( this, wantedang );
}
